import logo from './logo.svg';
import satelite from './img'
import './App.css';
import './Home_component.css'

function Home_component() {
    return (
      <body className="Home_component">
        <main className="Home_component_header">
          <img src={logo} className="App-logo planet" alt="logo" />
            <div className = "sputnik">

            </div>
            <div class="box">
                <img src = "../src/img/"  width="300" height="300">
                <circle fill="none" stroke="#000" stroke-width="3" cx="150" cy="150" r="100" />
                <circle cx="150" cy="150" r="10" stroke="red"></circle>
                <g class="orbit">
                    <circle cx="80" cy="80" r="20"></circle>
                 </g>
                </img>
            </div>
        </main>
      </body>
    );
  }
  export default Home_component;
